import React from 'react';
import Navbar from '../components/Navbar';
import Hero from '../components/Hero';
import Footer from '../components/Footer';

function PartnerDashboard() {
  return (
    <>
      <Navbar/>
      <Hero
        cName="hero-contact"
        heroImg={"https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.goodthingsguy.com%2Fpeople%2Fmoods-of-beautiful-johannesburg-skyline-photos-go-viral%2F&psig=AOvVaw2TZjXA2KRfk7fGB3LsHBcw&ust=1670470996495000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCMjagsXL5vsCFQAAAAAdAAAAABAE"}
        title="Partner Dashboard"
        btnClass="hide"
      />
      <Footer/>
    </>
  )
}

export default PartnerDashboard
